I think the problem is that you're using nextInt() to get the user's input, but you're not checking if the input is actually an integer. If the user enters something that's not an integer (like "left" or "right"), nextInt() will throw an InputMismatchException and your program will crash.
To fix this, you can use nextLine() instead of nextInt() to get the user's input as a string, and then use Integer.parseInt() to convert the string to an integer. Here's an example:
System.out.println("You come across a fork in the road. Which way do you go?");
